import React from "react";
import students_img from './../assets/students.png'
import './Auth'

const Auth = (props) =>{
    return(
        <div className="auth">
            <div className="">
                <img width="100" src={students_img}/>
            </div>
            <div>
                {
                    props.children
                }
            </div>
        </div>
    )
}

export default Auth;
